Uma locomotiva é um veículo ferroviário que fornece a energia necessária para a colocação de um comboio ou trem em movimento; as locomotivas não têm capacidade de transporte própria, quer de passageiros, quer de carga. No entanto, alguns comboios, possuem unidades (carruagens) mistas auto-alimentadas que também servem principalmente, para o transporte de pessoas; a esses veículos, no entanto, não se dá normalmente o nome de locomotiva, mas trem unidade. Existem muitas razões para que ao longo dos tempos se tenha isolado a unidade fornecedora de energia do resto do comboio: 
* Facilidade de manutenção – é mais fácil a manutenção de um único veículo; 
* Segurança – Existe mais facilidade de afastar a fonte de energia dos passageiros, em caso de perigo; 
* Fácil substituição da fonte de energia – em caso de avaria, só existe a necessidade de substituir a locomotiva e não todo o comboio; 
* Eficiência – Os comboios fora de circulação, gastam menos energia quando há necessidade da sua movimentação; 
* Obsolescência – Quando a unidade de energia ou as unidades de carga se tornam obsoletas não é necessária a substituição de todos os elementos.
